import React from 'react';
import NavBar from '../navBar/navBar'
import {Link} from "react-router-dom";
import {getAll} from '../../data/users'

class Users extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: []
        };
    }

    async componentDidMount(){
        try{
            const users = await getAll();
            if(users){
                this.setState({
                    users
                })
            }
        }catch(error){
            console.log(error)
        }
    }

    render() {
        const {users} = this.state
        console.log("users", users)
        return (
            <div className={"container-fluid"}>
                <div className={"row justify-content-between wrap-img-div"}>
                    <NavBar/>
                    {users && users.map((user, i) =>
                        <div className={"col-12 col-sm-10 col-lg-8 col-xl-3 img-div"}>

                            {user.role_id === 1 ?
                            <div className={"inner-div"}>
                                <h4>Admin</h4>
                                <p>ID:{user.id}</p>
                                <p>{user.first_name}</p>
                                <p>{user.last_name}</p>
                                <p>{user.email}</p>
                                <p>{user.phone}</p>
                                <p>{user.status}</p>
                            </div>

                                :

                            <div className={"inner-div"}>
                                <h4>User</h4>
                                <p>ID:{user.id}</p>
                                <p>{user.first_name}</p>
                                <p>{user.last_name}</p>
                                <p>{user.email}</p>
                                <p>{user.phone}</p>
                                <p>{user.status}</p>
                            </div>


                            
                            }
                        </div>
                    )}
                
                </div>
            </div>
        );
    }
}

export default Users;
